public class InnerTestCaseResourceActionFactory(Action<Humidifier.AppTest.TestCaseTypes.ResourceAction> factoryAction = null) : SubResourceFactory<Humidifier.AppTest.TestCaseTypes.ResourceAction>
{

    internal InnerTestCaseCloudFormationActionFactory CloudFormationActionFactory { get; set; }

    internal InnerTestCaseM2ManagedApplicationActionFactory M2ManagedApplicationActionFactory { get; set; }

    internal InnerTestCaseM2NonManagedApplicationActionFactory M2NonManagedApplicationActionFactory { get; set; }

    protected override Humidifier.AppTest.TestCaseTypes.ResourceAction Create()
    {
        var resourceActionResult = CreateResourceAction();
        factoryAction?.Invoke(resourceActionResult);

        return resourceActionResult;
    }

    private Humidifier.AppTest.TestCaseTypes.ResourceAction CreateResourceAction()
    {
        var resourceActionResult = new Humidifier.AppTest.TestCaseTypes.ResourceAction();

        return resourceActionResult;
    }
    public override void CreateChildren(Humidifier.AppTest.TestCaseTypes.ResourceAction result)
    {
        base.CreateChildren(result);

        result.CloudFormationAction ??= CloudFormationActionFactory?.Build();
        result.M2ManagedApplicationAction ??= M2ManagedApplicationActionFactory?.Build();
        result.M2NonManagedApplicationAction ??= M2NonManagedApplicationActionFactory?.Build();
    }

} // End Of Class

